import { connect } from "react-redux";
import Auction from './Auction'
import { setProductsList } from '../../store/actions/user'
import { Link, BrowserRouter as Router } from 'react-router-dom';

const AuctionList = (props) => {
    return (<div>
     
        <Router>
            {props.arr.map((item) => {
                return (
                    <Link onClick={()=>setProductsList()} to={`/auction:${item.code}`} component={ViewAuction}>
                        <Auction key={parseInt(item.code)} item={item} />
                    </Link>)
            })}
        </Router>
    </div>);
}
const mapStateToProps = (state) => {
    return {
        arr: state.main.auctionsList,
    }
}

export default connect(mapStateToProps, {  })(AuctionList);
